/* tslint:disable */
/**
*/
export class BufferStruct {
  free(): void;
  length: number;
  pointer: number;
}
/**
*/
export class EmuInterface {
  free(): void;
/**
* @param {Uint8Array} buffer 
* @returns {EmuInterface} 
*/
  static new(buffer: Uint8Array): EmuInterface;
/**
* @returns {BufferStruct} 
*/
  get_frame(): BufferStruct;
/**
* @param {KeyCode} key 
* @param {boolean} state 
*/
  set_button(key: KeyCode, state: boolean): void;
}
/**
*/
export class KeyCode {
  free(): void;
/**
* @param {number} val 
* @returns {KeyCode} 
*/
  static new(val: number): KeyCode;
}
